define({
    inputs:{
       startSearch: "bolean", 
       previousTitle:"string",
       speechRate:"number",
    },
    outputs: {
        topLeft: "boolean",
        backHome: "boolean",
        doubleTap: "boolean",
        repeat: "boolean",
     },
    setup: function(inputs, outputs) {
        var timerEvent;
        var first_press = false;
        var synth = window.speechSynthesis;
        var self = this;
        var rate = 1;
        document.addEventListener("keydown", function(e) {
            if((e.keyCode === 13)||(e.keyCode==96)) {
                if(first_press) {
                 // they have already clicked once, we have a double
                    self.sendSignalOnOutput("doubleTap");
                    clearTimeout(timerEvent);
                    first_press = false;
                }
                else{
                      // this is their first key press
                       first_press = true;

                     // if they don't click again in half a second, reset
                     timerEvent = window.setTimeout(function() { first_press = false; synth.cancel();
                     self.sendSignalOnOutput("repeat"); }, 1000);
                }
                }
            else if((e.keyCode === 110)|| (e.keyCode === 97)) {
                synth.cancel();
                switch(inputs.previousTitle){
                    case "MainMenu":
                    case "":
                        audio0.play();
                        break;

                    case "Entertainment":
                    case "Service":
                    case "Food":
                    case "Other": 
                        audio1.play();       
                        break;
                    case "Podcasts":
                    case "SearchForMovies":
                    case "Music":
                        audio2.play();
                        break;

                    case "SearchA":
                    case "SearchB":
                    case "SearchC":
                    case "SearchD":
                    case "SearchE":
                    case "SearchF":
                    case "SearchG":
                    case "SearchH": 
                        audio3.play();
                        break;
                    default:
                        break;
                }
                if(inputs.previousTitle==""){
                    var msg1 = new SpeechSynthesisUtterance("This is Main Menu");
                    msg1.rate=rate;
                    synth.speak(msg1)
                    self.sendSignalOnOutput("repeat");
                }
                else{
                    var msg2 = new SpeechSynthesisUtterance("This is " + inputs.previousTitle);
                    msg2.rate=rate;
                    synth.speak(msg2);
                    self.sendSignalOnOutput("backHome");
                }

            }

             else if((e.keyCode === 38)) {
                 // Increase speak rate
                 if(inputs.speechRate<8){
                     Noodl.setGlobalValue("speech.rate", inputs.speechRate+0.25);
                    audioIncreaseRate.load();
                     audioIncreaseRate.play();

                 }
            }
             else if((e.keyCode === 40)) {
                 // Decrease speak rate
                 if(inputs.speechRate>0.25){
                    Noodl.setGlobalValue("speech.rate", inputs.speechRate-0.25);
                    audioDecreaseRate.load();
                    audioDecreaseRate.play();
                 }
             }

        });

}   
